import React from "react";

function Jumbotron({ children }) {
  return (
    <div
      style={{ height: 120, width: 300, clear: "both", paddingTop: 20, textAlign: "center" }}
      className="jumbotron"
    >
      {children}
    </div>
  );
}

export default Jumbotron;
